import React from 'react';
import {Link} from 'react-router-dom';

import './NavBar.css'

export const Nav = () => {
	return (
		<div className="nav">
			<div className='div_logo'>

					<h2>Pokemon Companion App</h2>

			</div>
			<div className='div_menu'>
				<div className='div_link'>

						HOME

				</div>
				<div className='div_link'>

						CREATE POKEMON

				</div>
			</div>
		</div>
	);
};

export default Nav;
